import React from 'react';
import {Link} from 'react-router-dom';

function Navbar() {
    const navbox = {
        backgroundColor: 'red',
        height: '60px'
    };
    return (
        <div style={navbox}>
            <li>
                <Link to="/">Home</Link>
            </li>
        </div>
    );
}

export default Navbar;
